import React from 'react'; 
import "./Navbar.scss"; 
import { Link } from 'react-scroll';
import { FaArrowUp } from 'react-icons/fa';

const Navbar = props => {
 return (
  <nav className="navbar">
    <ul>
      <li>
        <Link to="about">
          About
        </Link>
      </li>
      <li>
        <Link to="projects">
          Projects
        </Link>
      </li>
      <li>
        <Link to="header">
          <FaArrowUp/>          
        </Link>
      </li>
    </ul>
  </nav>
 );
} 

export default Navbar;
